import React, { Component } from 'react';
import './component/css/App.css';
import './component/css/Header.css';

class App extends Component {
  render() {
    return (

 <div className="App">
        <p className="App-intro">
          To get started, edit <code>src/App.js</code> and save to reload.
        </p>
      </div>
    );
  }
}
export default App;
